package varios;

public class Boleta {

	private int numero;
	private String fecharendicion;
	private String beneficiario;
	private int monto;
	private String estadoboleta;
	private String motivo;
	
	public Boleta() {
		// TODO Auto-generated constructor stub
	}

	public int getNumero() {
		return numero;
	}

	public void setNumero(int numero) {
		this.numero = numero;
	}

	public String getFecharendicion() {
		return fecharendicion;
	}

	public void setFecharendicion(String fecharendicion) {
		this.fecharendicion = fecharendicion;
	}

	public String getBeneficiario() {
		return beneficiario;
	}

	public void setBeneficiario(String beneficiario) {
		this.beneficiario = beneficiario;
	}

	public int getMonto() {
		return monto;
	}

	public void setMonto(int monto) {
		this.monto = monto;
	}

	public String getEstadoboleta() {
		return estadoboleta;
	}

	public void setEstadoboleta(String estadoboleta) {
		this.estadoboleta = estadoboleta;
	}

	public String getMotivo() {
		return motivo;
	}

	public void setMotivo(String motivo) {
		this.motivo = motivo;
	}
	
}
